INSERT INTO `emails` VALUES ('40', 'Accounts', '<div><a target=\"_blank\" rel=\"nofollow\" href=\"https://corporatefinanceinstitute.com/resources/knowledge/accounting/net-book-value/\" title=\"Link: https://corporatefinanceinstitute.com/resources/knowledge/accounting/net-book-value/\"><h3>Net Book Value - Overview, Formula, and Importance</h3><br>https://corporatefinanceinstitute.com › Resources › Knowledge › Accounting</a></div><div><div><span>Net book value&nbsp;(NBV) refers to a company’s assets or how the assets are recorded by the accountant.&nbsp;... When calculating&nbsp;NBV, the depletion or depreciation and any amortization of the asset’s value must be subtracted from the original cost over the course of the asset’s useful life.</span></div></div><br>', 'PRINCE MUNENE MBABU', '0726738023', '90', '16/01/2020', '04:29 PM', '20200116', '202001161629', '0', '', '0', '');
